    //       <p className="display-inline">{data.data.description}</p>
    //     </div>
    //   </div>
    // </Link>

    <div class="grid-item">
      <div class="item-style">
        <div class="thumb">
          <a href="#">src={IPFSUrl}</a>
          <button class="reaction-btn">
            <i class="ri-heart-fill"></i>
            <span>69</span>
          </button>
        </div>

        <div class="content">
          <h3 class="title">
            <a href="#">Name NFT #1</a>
          </h3>

          <div class="profile d-flex-center">
            <a href="#">
              <img
                src="https://yt3.ggpht.com/QjvZEAyWwOGtkY4D36Q8tiblGg3vXwaohmUkr_zMNGatyLEniLkWq_MRpC7RaZNtoXbbcvC5tw=s900-c-k-c0x00ffffff-no-rj"
                class="image-avatar"
                alt=""
              />
            </a>
            <a href="#" class="author-text">
              @author_name
            </a>
            <i class="ri-shield-check-fill"></i>
          </div>

          <div class="product-owner d-flex-center">
            <span class="bid-owner">
              PRICE: <strong>(2 / 10)</strong>
            </span>
            <span class="biding-price d-flex-between">
              <i class="ri-arrow-up-line"></i>
              99.1 ETH
            </span>
          </div>

          <div class="product-buy d-flex-between">
            <a href="#" class="btn">
              <span>
                <i class="ri-time-line"></i> 21 hours left
              </span>
            </a>
            <a href="#" class="btn btn-cart btn-outline">
              <span>
                <i class="ri-shopping-cart-line"></i> Buy
              </span>
            </a>
          </div>
        </div>
      </div>
    </div>
  );
}

export default NFTTile;
